// src/App.js

import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import OcrPage from "./pages/OcrPage";
import PlayerRegister from "./pages/PlayerRegister";
import SchoolDashboard from "./pages/SchoolDashboard";
import SchoolRegistrationWizard from "./pages/SchoolRegistrationWizard"; // Import your wizard!
import { LangProvider } from "./contexts/LangContext"; // Your language context

function App() {
  return (
    <LangProvider>
      <Router>
        <div className="p-4">
          {/* Language toggle is inside each page/component using useLang */}
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/ocr" element={<OcrPage />} />
            <Route path="/register-player" element={<PlayerRegister />} />
            <Route path="/dashboard" element={<SchoolDashboard />} />
            <Route path="/school-register" element={<SchoolRegistrationWizard />} />
            {/* Add more routes as needed */}
          </Routes>
        </div>
      </Router>
    </LangProvider>
  );
}

export default App;
